class jsonifyMyTable{constructor(e){if(this.table=document.getElementById(e),!this.table)return this.error=!0,void console.error("Table not found.");this.headers=[];for(let e=0;e<this.table.rows[0].cells.length;e+=1)this.headers.push(this.table.rows[0].cells[e].innerText);if(this.headers.length>new Set(this.headers).size)return this.error=!0,void console.error("Headers repeat.");this.res=[];for(let e=1;e<this.table.rows.length;e+=1){let s=[];for(let t=0;t<this.table.rows[e].cells.length;t+=1)s.push(this.table.rows[e].cells[t].innerText);let t={};this.headers.forEach((e,r)=>t={...t,[e.valueOf()]:s[r]}),this.res.push(t)}}}exports.jsonifyMyTable=jsonifyMyTable;
